import Container from '@mui/material/Container';
import Folder from '../../assets/mycomputericon.png'
import Popup from 'reactjs-popup';
import "./MyProjectsFolderGroup.css"


export function MyProjectsGroup(){
    return(
        <div className='Project-Container-Properties' >
            <ProjectIcon/>
            <ProjectsText />
        </div>
    )
} 

export function ProjectIcon(){
    return(
        <img src={Folder}
        className='Project-icon'
        alt='Project icon'
        />
    )
}

export function ProjectsText(text){
    text = "My Projects"
    return(
        <p className='FolderText'>
            {text}
        </p>
    )
}
